webpackJsonp([0xcb6c202cefc3],{1161:function(t,e){t.exports={data:{site:{siteMetadata:{title:"Justin Ball",author:"Justin Ball"}},markdownRemark:{id:"/Users/jbasdf/projects/justinball/src/posts/2018-01-23-Cryptography/index.md absPath of file >>> MarkdownRemark",html:'<p>I was trying to find a good resource for understanding the mathematics behind cryptography and came across <a href="https://www.youtube.com/playlist?list=PLYRxaDweTODWOgZmuHQ9XK8t5lvbnQRU-">Christof Paar\'s cryptography series on YouTube</a>. This is the best set of lectures on understanding the fundamentals of cryptography that I\'ve found.\nIt\'s 24 hours of video spread across a semester of classes so it will take a while to work through them, but they are worth the time. He does a great job teaching the math and reason for the math. Christof has a companion book available on <a href="http://www.crypto-textbook.com/">crypto-textbook.com</a>.</p>\n<div id="PLYRxaDweTODWOgZmuHQ9XK8t5lvbnQRU-" class="youtube-playlist">\n  <h2 class="youtube-title">Cryptography</h2>\n  <iframe src="https://www.youtube.com/embed/list=PLYRxaDweTODWOgZmuHQ9XK8t5lvbnQRU-" frameborder="0" width="640" height="385" allowfullscreen>\n    <p>Your browser does not support iframes.</p>\n  </iframe>\n</div>',frontmatter:{title:"Cryptography",date:"January 23, 2018",imageUrl:"https://img.youtube.com/vi/aeOzBCbwxUo/sddefault.jpg",structuredHtml:null,image:null}}},pathContext:{path:"/Cryptography"}}}});
